Robert Bateman, &quot;Bateman: New Works&quot; 
English | ISBN: 1553655796, 1771640723 | 2010 | 176 pages | PDF | 48 MB

The long-awaited collection of new works by the world s most beloved wildlife painter and conservationist. Bateman, who celebrated his 80th birthday in 2010, continues to be a prolific artist and active public speaker. All of the art in this book is recent and has never been published in book form before. Bateman s works have been the focus of sell-out shows in the US and UK, including an exhibition at the Smithsonian Institution in Washington, DC. A true naturalist, Bateman is utterly committed to promoting the protection of wildlife and their environs. Every detail of his art and writings support and inspire this goal.
